import numpy as np
class Solution(object):
    def numEnclaves(self, A):
        """
        :type A: List[List[int]]
        :rtype: int
        """
        # return 1 if reachable else 0
        def dfs(i,j,v):
            if (i,j) in v: return
            v.add((i,j))
            for a,b in [(i-1,j),(i+1,j),(i,j-1),(i,j+1)]:
                if 0<=a<m and 0<=b<n and A[a][b] == 1: 
                    dfs(a,b,v)
            A[i][j] = 2
            return

        #print ' before \n', np.array(A)
        m,n,v = len(A), len(A[0]), set()
        for i in range(1,m-1):
            if A[i][0] == 1: dfs(i,0,v)
            if A[i][n-1] == 1: dfs(i,n-1,v)
        for j in range(1,n-1):
            if A[0][j] == 1: dfs(0,j,v)
            if A[m-1][j] == 1: dfs(m-1,j,v)

        #print ' after \n', np.array(A)
        res = 0
        for i in range(1,len(A)-1):
            for j in range(1,len(A[0])-1):
                if A[i][j] == 1: res += 1
        return res

